增加字符传压缩辅助方法
 Stopwatch stopwatch = new Stopwatch();
            stopwatch.Start();
            var resultStr=oriStr.CompressZipBase64();
            stopwatch.Stop();

            Console.WriteLine("压缩后字符长度："+resultStr.Length+"---"+stopwatch.ElapsedMilliseconds);

            Console.WriteLine("================================================================================================");
            stopwatch.Reset();
            stopwatch.Start();
            var oriNewStr=resultStr.DeCompressZipBase64();
            stopwatch.Stop();
            Console.WriteLine(oriNewStr==oriStr);

